-- Check Alif Alif Atoll ID
SELECT id, name FROM atolls WHERE name = 'Alif Alif Atoll';

-- Check islands with atollId for Alif Alif Atoll
SELECT p.id, p.name, p.slug, p.atollId, a.name as atoll_name
FROM places p
LEFT JOIN atolls a ON p.atollId = a.id
WHERE p.type = 'island' AND a.name = 'Alif Alif Atoll'
LIMIT 10;

-- Check total islands with atollId
SELECT COUNT(*) as total_with_atoll_id FROM places WHERE type = 'island' AND atollId IS NOT NULL;
SELECT COUNT(*) as total_without_atoll_id FROM places WHERE type = 'island' AND atollId IS NULL;

